import { AppBar, Toolbar, Typography } from '@mui/material'
import React from 'react'
import HomeIcon from '@mui/icons-material/Home';

const Navbar = () => {
  return (
    <React.Fragment>
        <AppBar sx={{backround : red }}> 
            <Toolbar>
            <HomeIcon/>
            
            </Toolbar>
        </AppBar>
    </React.Fragment>
  )
}

export default Navbar;
